import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import female12 from '../../src/images/female12.png'
import female15 from '../../src/images/female15.png'

export default class FemalePics extends Component {
    constructor() {
        super()

        this.state = {
            bodyFat12: 0.12,
            bodyFat15: 0.15,
            bodyFat25: 0.25

        }
    }


    render() {
        return (
            <div>
                <Link  to={{ 
                        pathname: "/input", 
                        state: this.state.bodyFat12,
                        }} ><img src={female12} alt="" /></Link>

                <Link to={{
                        pathname: '/input',
                        state: this.state.bodyFat15
                        }} ><img src={female15} alt="" /></Link>

            </div>
        )
    }
}
